    data: |
      SELECT DISTINCT 99 FROM tab1 WHERE NOT ( col2 * - col0 - - col0 ) NOT IN ( - 14 * - col2 ) OR col1 / - col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q2123.out
    data: |
      99
